{"query":"query blocksQuery($first: Int! = 1000, $skip: Int! = 0, $start: Int!, $end: Int!) {
  blocks(first: $first, skip: $skip, orderBy: number, orderDirection: desc, where: {timestamp_gt: $start, timestamp_lt: $end}) {
    ...blockFields
  }
}

fragment blockFields on Block {
  id
  number
  timestamp
}
","variables":{"start":1627459200,"end":1627480800}}

{"query":"query pair($skip: Int = 0, $first: Int = 1000, $where: Pair_filter, $block: Block_height, $orderBy: Pair_orderBy = "trackedReserveETH", $orderDirection: OrderDirection = "desc") {
  pairs(skip: $skip, first: $first, orderBy: $orderBy, orderDirection: $orderDirection, block: $block, where: $where) {
    ...pairFields
  }
}

fragment pairFields on Pair {
  id
  reserveUSD
  reserveETH
  volumeUSD
  untrackedVolumeUSD
  trackedReserveETH
  token0 {
    ...PairToken
  }
  token1 {
    ...PairToken
  }
  reserve0
  reserve1
  token0Price
  token1Price
  totalSupply
  txCount
  timestamp
}

fragment PairToken on Token {
  id
  name
  symbol
  totalSupply
  derivedETH
}
